/* /components/Layout.js */
import { Container } from 'reactstrap'
import Navibar from './Navbar'
import Meta from './Meta'
import Footer from './Footer'
const Layout = (props) => {
  return (
    <>
      <Meta />
      <style jsx>
        {`
          .bg {
            background: #fffdf1;
            height: 100vh;
          }
        `}
      </style>
      <Navibar />
      <div className='bg'>
        <Container>{props.children}</Container>
        <Footer />
      </div>
    </>
  )
}

export default Layout
